import { Injectable } from '@angular/core';
import { Confirmation, ConfirmationService } from 'primeng/api';

@Injectable()
export class FreudConfirmationService {

  constructor(private primeConfirmation: ConfirmationService) {}

  requireConfirmation$ = this.primeConfirmation['requireConfirmationSource'].asObservable();
  accept = this.primeConfirmation['acceptConfirmationSource'].asObservable();

  confirm(confirmation: Confirmation) {
    this.primeConfirmation['requireConfirmationSource'].next(confirmation);
    return this;
  }

  close() {
    this.primeConfirmation['requireConfirmationSource'].next(null);
    return this;
  }

  onAccept() {
    this.primeConfirmation['acceptConfirmationSource'].next(null);
  }

}

import { Injectable } from '@angular/core';
import { Message, MessageService } from "primeng/api";

@Injectable()
export class FreudMessageService {

  constructor(private primeMessage: MessageService) { }

  messageObserver = this.primeMessage['messageSource'].asObservable();
  clearObserver = this.primeMessage['clearSource'].asObservable();

  add(message: Message) {
    if (message) {
      this.primeMessage['messageSource'].next(message);
    }
  }

  addAll(messages: Message[]) {
    if (messages && messages.length) {
      this.primeMessage['messageSource'].next(messages);
    }
  }

  clear(key?: string) {
    this.primeMessage['clearSource'].next(key || null);
  }
}

