    class: 'freud-gallery',
    '[class.freud-bgcolor]': `bgColor`,
  }
})
export class FreudGalleryComponent {
  @Input() images: GalleryPhoto[] = [];
  @Input() bgColor: boolean = false;
  @Input() showThumbnails: boolean = true;

  @Input() responsiveOptions = [
    {
      breakpoint: '1366px',
      numVisible: 9
    },
    {
      breakpoint: '1024px',
      numVisible: 8
    },
    {
      breakpoint: '960px',
      numVisible: 5
    },
    {
      breakpoint: '768px',
      numVisible: 4
    },
